import React from "react";
import { SafeAreaView, Text,View } from "react-native";
import AppbarMessages from "../AppBars/AppbarMessages";
import IconAD from 'react-native-vector-icons/Feather';
import tw from "twrnc";

export default function Messages() {
  return (
    <SafeAreaView style={tw`w-[100%] flex-1 bg-white`}>
      <AppbarMessages />

      {/* Search Header  */}
      <View style={tw`px-[13px] py-[5px] flex-row items-center justify-between`}>
          <View style={tw`bg-[#e6e6e6] px-[16px] py-[8px] w-[85%] rounded-[10px] flex-row items-center`}>
            <IconAD name="search" size={18} style={tw`mr-[13px] text-[#6E6E6E]`}/>
            <Text style={tw`text-[14px] text-[#6E6E6E]`}>Search</Text>
          </View>
          <Text style={tw`text-[#1FA1FF] font-bold text-[12px]`}> Filter</Text>
      </View>

      {/* Tabs Header  */}
      <View style={tw`px-[13px] py-[5px] flex-row items-center justify-between`}>
        <View style={tw`w-[30%] h-[36px] items-center justify-center bg-[#129cff40] rounded-[10px]`}><Text style={tw`text-[#1FA1FF]`}>Primary</Text></View>
        <View style={tw`w-[30%] h-[36px] items-center justify-center bg-[#e6e6e6] rounded-[10px]`}><Text style={tw`text-[#6E6E6E]`}>Primary</Text></View>
        <View style={tw`w-[30%] h-[36px] items-center justify-center bg-[#e6e6e6] rounded-[10px]`}><Text style={tw`text-[#6E6E6E]`}>Primary</Text></View>
      </View>

    </SafeAreaView>
  );
}
